/*Data for the table `siab_artikel_prb` */

insert  into `siab_artikel_prb`(`id_artikel`,`judul`,`isi`,`tgl_post`) values (2,'Coba Login Skrill','<p>Login to your Skrill account at <span style=\"font-weight: bold;\">www.skrill.co<span style=\"vertical-align: super;\">m</span>,</span> go to Settings and choose Developer Settings to access the option. <a href=\"http://google.com\" target=\"_blank\">When enabling</a>, you will be asked to specify IPs or IP ranges from which you will send queries to the Skrill API. Enter IPs or IP<span style=\"font-style: italic;\"> ranges separated by spaces</span>. A separate password to access the </p><p><ul><li><span style=\"line-height: 1.42857143;\">Skrill API and MQI services will be required.</span><br></li></ul></p>','2015-06-18'),(3,'aaaa','<p>oke</p>','2015-06-18'),(4,'Longsor Nglambor','<p><span style=\"font-weight: bold;\">Yogyakarta </span>- Peristiwa tebing longsor di Pantai Sadranan, Tepus, Gunungkidul, DIY menyisakan duka. Seorang korban yang selamat dari peristiwa nahas tersebut tergolek lemas di rumah sakit.</p><p>Karsiyem (40), korban tebing longsor menjalani perawatan intensif di RSUD Wonosari, Gunungkidul. Ia baru siuman pagi tadi pukul 05.30 WIB. Korban saat kejadian berada di dekat lokasi runtuh. Dia kemudian tertimpa reruntuhan tebing. Korban mengalami luka dan akan dioperasi. Karsiyem merupakan warga Karangmojo, Gunungkidul.</p><p>Putri korban, Siska Dewi Novitasari (19) mengatakan kondisi ibunya sudah siuman. Namun takut jika mendengar suara ambulance. Korban dirawat intensif di ruang anggrek RSUD Wonosari.</p><p>\"Ibu bilang sekarang takut ke pantai lagi. Terus kalau dengar suara ambulance juga takut,\"kata Siska di RSUD Wonosari, Gunungkidul, DIY, Kamis (18/6/2015).</p><p>Saat kejadian, Karsiyem memang sedang melakukan tradisi padusan bersama keluarganya. Rombongannya saat itu sebanyak 13 orang. Yang terkena reruntuhan longsor hanya Karsiyem, karena yang lain sedang bermain air di laut. Sementara Karsiyem berada di sekitar tebing.</p><p>\"Suara longsor keras sekali, seperti suara bom gitu. Boomm, langsung runtuh,\"kata Siska.</p><p><br></p>','2015-06-18'),(5,'COba gambar','<p><br></p><img src=\"data:image/png;base64,','2015-06-18'),(6,'asasas','<p>asasasas</p><p><br></p><img src=\"http://aqvatarius.com/themes/atlant/html/assets/images/blog/post_1.jpg\" style=\"width: 667px;\"><p><br></p>','2015-06-18'),(7,'asik','<p><br></p><img src=\"data:image/jpeg;base64,','2015-06-18'),(8,'as','<p><br></p><img src=\"data:image/jpeg;base64,','2015-06-18'),(9,'asasa','<p>asasa</p><p><br></p><img src=\"data:image/jpeg;base64,','2015-06-18'),(10,'s','<p><br></p><img src=\"data:image/jpeg;base64,','2015-06-18'),(11,'coba','<p><br></p><img src=\"data:image/jpeg;base64,','2015-06-20');

